import './App.css';
import Alert from 'react-bootstrap/Alert';
import Nav from 'react-bootstrap/Nav';

function App() {
  return (
    <Alert variant='secondary'>
      <Nav>
        <Nav.Item>
          <Nav.Link>NEWS</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link>ITALIANO</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link>ENGLISH</Nav.Link>
        </Nav.Item>
      </Nav>
    </Alert>
  );
}

export default App;
